Minimum Reforms in the Judiciary:
1. Resignation of C J Martha Koome;
2. Resignation of all Supreme Court Judges;
3. Formation of at least 30 Tribunals to consider petitions for removal of High Court and ELC Judges; and
4. Enactment of Vetting of Judges and Magistrates Act.

Chief Justice Martha Koome has redefined leadership in Kenya’s Judiciary. Her unwavering commitment to access to justice, integrity, and meaningful reforms has set the foundation for a stronger, more inclusive judicial system. A trailblazer 
